import './App.css';
import BottomBar from './components/bottom-bar.js';
import { AboutMeFolderGroup } from './components/AboutMeFolderIcon.js';
import { MyComputerGroup } from './components/MyComputerGroup.js';
import "98.css";
import Popup from 'reactjs-popup';
import {MyComputerPopUp} from './components/MyComputerPopUp.js';
import { AboutMePopUp } from './components/AboutMePopUp.js';
import avatar from './assets/pixel_avatar.png'




function App() {
  return (
    <div className="App"> 
      <header className="App-header">
        <body>
        <Popup
          trigger={MyComputerGroup}
          position="center center"
          closeOnDocumentClick
        >
          <MyComputerPopUp />
        </Popup>
        <Popup
          trigger={AboutMeFolderGroup}
          position="center center"
          closeOnDocumentClick
        >
          <AboutMePopUp  />
        </Popup>
      </body>
      <img src={avatar} className='MyAvatar' />
      </header>

      <BottomBar>  
      </BottomBar>
    </div>

  );
}



export default App;
